import {
  Avatar,
  Box,
  Card,
  CardContent,
  Grid,
  Typography,
} from "@mui/material";
import Checkbox from "@mui/material/Checkbox";
import TextField from "@mui/material/TextField";
import TextareaAutosize from "@mui/base/TextareaAutosize";

export const CreateIntegration = (props) => (
  <CardContent>
    <Grid >
    <TextField
      required
      id="outlined-required"
      label="Obrigatório"
      defaultValue="Nome da integração"
    />
    <TextareaAutosize
      required
      id="outlined-required"
      label="Obrigatório"
      defaultValue="descrição da integração"
      style={{ width: 200 }}
      minRows={10}
      minLength={10}
    />
    </Grid>
  </CardContent>
);
